import React from 'react';

export default function Header() {
  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark shadow-sm">
      <div className="container">
        <a className="navbar-brand fw-bold" href="#" style={{ color: '#f7931a' }}>
          <img src="https://cryptologos.cc/logos/bitcoin-btc-logo.png" alt="Bitcoin" width="32" className="me-2" />
          Bitcoin Predictor
        </a>
      </div>
    </nav>
  );
}
